import '../css/page16.css';
import React from 'react'
import anime from "animejs";

function Page16(props){
  let obj1 = document.querySelector('#Page16Signal1');
  if(obj1 !== null) obj1.style.display = '';
  let obj2 = document.querySelector('#Page16Signal2');
  if(obj2 !== null) obj2.style.display = '';
  // let obj3 = document.querySelector('#Page16Node2');
  // if(obj3 !== null) obj3.style.borderStyle = 'dotted';

  function animation() {
    let anime1 = anime({
      targets: '#Page16Node2',
      borderStyle: 'dotted',
      borderWidth: 6,
      duration: 0,
      easing: 'linear',
    });
    let animation1 = anime.timeline().add({
      targets: '#Page16Signal1',
      opacity: 1,
      translateX: 28,
      translateY: -72,
      easing: "linear",
      duration: 0,
    }).add({
      targets: '#Page16Signal1',
      translateX: -73,
      translateY: 129,
      easing: "linear",
      duration: 2500,
      complete: function () {
        let obj1 = document.querySelector('#Page16Signal1');
        obj1.style.display = 'none';
        anime({
          targets: '#Page16Signal1',
          opacity: 0,
          translateX: 28,
          translateY: -72,
          easing: "linear",
          duration: 0,
        });
      }
    });

    let animation2 = anime.timeline().add({
      targets: '#Page16Signal2',
      opacity: 1,
      translateX: 127,
      translateY: 129,
      easing: "linear",
      duration: 0,
    }).add({
      targets: '#Page16Signal2',
      translateX: -73,
      easing: "linear",
      duration: 2500,
      complete: function() {
        let obj1 = document.querySelector('#Page16Signal2');
        obj1.style.display = 'none';
        let anime1 = anime({
          targets: '#Page16Signal2',
          opacity: 0,
          translateX: 127,
          translateY: 129,
          easing: "linear",
          duration: 0,
        });
        // let obj2 = document.querySelector('#Page16Node2');
        // obj2.style.borderStyle = 'solid';
      }
    });
  }

  if(props.display) animation();

  return(
      <div style={{display: props.display?'': 'none'}}>
        <div className="Page16NodeDes" id="Page16NodeDes1">
          <div> Node b<br/></div>
          <div> Term: 0</div>
        </div>
        <div className="Page16Node" id="Page16Node1"/>
        <div className="Page16NodeDes" id="Page16NodeDes2">
          <div> Node a<br/></div>
          <div> Term: 0<br/></div>
          <div> Vote Count: 0</div>
        </div>
        <div className="Page16Node" id="Page16Node2"/>
        <div className="Page16NodeDes" id="Page16NodeDes3">
          <div> Node c<br/></div>
          <div> Term: 0</div>
        </div>
        <div className="Page16Node" id="Page16Node3"/>
        <div className="Page16Signal" id="Page16Signal1"/>
        <div className="Page16Signal" id="Page16Signal2"/>
        <div className="Page16Text" id="Page16Text1"> Nodes will reply with their vote. </div>
      </div>
  );
}

export default Page16;
